Few cases I could think of :
1. Handling just assignments: `z = a.z`
1.a. Make sure that solution `({z} = a);` is wrapped in parenthesis to make valid expression
2. Longer assignment expressions: `blah = z = a.z` (which is different from `blah = {z} = a`)
3. Merging different property names from same object ??
```js
// from
let x = a.x;
let y = a.y;
let z = a.z;

// to
let {x, y, z} = a;

// Merging with nesting ??
// from
let x = a.x;
let y = a.something.y;
let z = a.something.z;

// to
let {x, something: {y, z}} = a;
```
This would be very very hard to implement correctly, but produce more human-like result.
